import { useState, useCallback } from 'react';
import { Layout, Card, FormLayout, TextField } from '@shopify/polaris';

const SubmitForm = () => {
    const [inputs, setInputs] = useState();

    const handleChange = useCallback((value) => { setInputs(value); console.log(inputs) }, []);

    return (
        <Layout>
            <Layout.AnnotatedSection
                title='Submit your problem'
                description='Specify what you are trouble in'
            >
                <Card sectioned>
                    <FormLayout>
                        <TextField label='Name' value='name' name='name' onChange={handleChange} />
                    </FormLayout>
                </Card>
            </Layout.AnnotatedSection>
        </Layout>
    )
}

export default SubmitForm;
